// ShowDoctorSchedule.js
import React, { useState, useEffect } from 'react';
import { adminApi, setAuthToken } from '../../api';
import { useLocation } from 'react-router-dom';

const ShowDoctorSchedule = () => {
  const [doctorSchedules, setDoctorSchedules] = useState([]);
  const location = useLocation();
  const { doctorId } = location.state;
  const handleEditSchedule = (scheduleId) => {
    // You can navigate to the edit-doctor-schedule route with both doctorId and scheduleId
    // Use Link or any other navigation method of your choice
    // Example using Link:
    history.push(`/edit-doctor-schedule/${doctorId}/${scheduleId}`);
  };
  useEffect(() => {
    setAuthToken();

    adminApi.getDoctorSchedules(doctorId)
      .then(response => {
        setDoctorSchedules(response.data.showDoctorSceduleDTO); // Assuming the array is inside data property
      })
      .catch(error => {
        console.error('Error fetching doctor schedules:', error);
      });
  }, [doctorId]);

  return (
    <div>
      <h2>Doctor Schedule</h2>
      {Array.isArray(doctorSchedules) && doctorSchedules.length > 0 ? (
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Day</th>
              <th>Time</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {doctorSchedules.map(schedule => (
              <tr key={schedule.SeduleId}>
                <td>{schedule.doc_DateOnly}</td>
                <td>{schedule.dateOfWeek}</td>
                <td>{`${schedule.startTime_TimeOnly} - ${schedule.endTime_TimeOnly}`}</td>
                <td>
                  {/* Edit button triggers handleEditSchedule function */}
                  <button onClick={() => handleEditSchedule(schedule.SeduleId)}>Edit</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      ) : (
        <p>No schedules available.</p>
      )}
    </div>
  );
};

export default ShowDoctorSchedule;
